def parse_page_range(page_str):
    pages = set()
    for part in page_str.split(','):
        if '-' in part:
            start, end = part.split('-')
            pages.update(range(int(start), int(end) + 1))  # Add pages in the range
        else:
            pages.add(int(part))
    return sorted(pages)
